import { Navigate } from "react-router-dom";

function App() {
    return ( <
        div >
        <
        BrowserRouter >
        <
        Navbar / >
        <
        Routes > { /* Redirect หน้าแรกไปยัง /login */ } <
        Route path = "/"
        element = { < Navigate to = "/login"
            replace / >
        }
        />

        <
        Route path = "/mens"
        element = { < ShopCategory banner = { men_banner }
            category = "ผู้ชาย" / >
        }
        /> <
        Route path = "/womens"
        element = { < ShopCategory banner = { women_banner }
            category = "ผู้หญิง" / >
        }
        /> <
        Route path = "/shirt"
        element = { < ShopCategory banner = { shop_banner }
            category = "เสื้อช็อป" / >
        }
        /> <
        Route path = "/ruls"
        element = { < ShopCategory banner = { line_banner }
            category = "เข้มขัด" / >
        }
        /> <
        Route path = "/shose"
        element = { < ShopCategory banner = { shoes_banner }
            category = "รองเท้า" / >
        }
        /> <
        Route path = "product"
        element = { < Product / > } >
        <
        Route path = ":productId"
        element = { < Product / > }
        /> < /
        Route > <
        Route path = "/cart"
        element = { < Cart / > }
        /> <
        Route path = "/login"
        element = { < LoginSignup / > }
        /> < /
        Routes > <
        Footer / >
        <
        /BrowserRouter> < /
        div >
    );
}

export default App;
